2005-A total of 10,000 metric tons of Phobos water delivered to Earth orbit in four missions supplies enough fuel to launch all the elements of permanent lunar and Mars bases, which are established later that year.
• 2010- Space colonies and settlements begin to spread across the solar system; energy to Earth is supplied by solar power satellites;
asteroids are mined for metals.
• 2020 - We have established world government, peace, telepathic communication with one another and with extraterrestrial beings;
